import React from 'react';
import './Header.css'
import styled from 'styled-components'


const Header = () => {
    return (
        // <Router>
            <header className='header'>   
                    <Navbar>
                        <div>
                            <a href="/">
                                <img className='logo' src="/Assets/logo.png" alt="logo" />
                            </a>
                        </div>
                        <ul>
                            <a href='/'>Home</a>
                            <a href='/'>About</a>
                            <a href='/'>Contact</a>
                        </ul>
                    </Navbar>
            </header>
        // </Router>
    );
}

export default Header;

const Navbar = styled.nav`
    .logo{
        width: 50px;
        padding: 10px;
        margin-left: 10px;
    }

    ul{
        a{
            margin-right: 15px;
            text-decoration: none;
            font-weight: bold;
            font-size: 20px;
            color: inherit;

           :hover{
                border-bottom: black solid;
                transition: 0.3s;
           }
        }
    }
    
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
   
`
